import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Image from 'react-bootstrap/Image';


export class Navigation extends React.Component{

    render()
    {
        return(
            <div>
                <Nav variant = "tabs" className="me-auto navigation" defaultActiveKey="/home">
                    <Nav.Item> <Image src="./assets/logo.png" className="navLogo"/> </Nav.Item>
                    <Nav.Link className="navLink" href="/home">Home</Nav.Link>
                    <Nav.Link className="navLink" href="#pricing">Dashboard</Nav.Link>
                </Nav>
            </div>
        );
    }
}
